import React from 'react';

import Images from "./Images";
import ScrollButton from "../../helpers/scroll/ScrollButton";
import {useMediaQuery} from "react-responsive";
import {RESPONSIVE} from "../../../responsive/Responsive";
import Scrolling from "../../helpers/scroll/Scrolling";
import HoverActions from "./hover/HoverActions";
import {useState} from "react";
import Paginate from "../../helpers/scroll/Paginate";
import TextHover from "../../helpers/TextHover";

function RowImages(props) {
    const mobile = useMediaQuery(
        RESPONSIVE.MOBILE
    )
    const responsive = mobile ? "col alItCenter" : "row alItCenter";


    const list = [
        <>
            <Images flex="0.25"/>
            <HoverActions flex={"0.5"} child={<Images/>} text={<TextHover text={"THe my"} />}/>
            <Images flex="0.25"/>
            <div style={{
                margin: "20px"
            }}/>
        </>,
        <>
            <Images flex="0.25"/>
            <HoverActions flex={"0.5"} child={<Images/>}/>
            <Images flex="0.25"/>
            <div style={{
                margin: "20px"
            }}/>
        </>,
        <>
            <Images flex="0.25"/>
            <HoverActions flex={"0.5"} child={<Images/>}/>
            <Images flex="0.25"/>
            <div style={{
                margin: "20px"
            }}/>
        </>,
        <>
            <Images flex="0.25"/>
            <HoverActions flex={"0.5"} child={<Images/>}/>
            <Images flex="0.25"/>
            <div style={{
                margin: "20px"
            }}/>
        </>,
    ]
    const paginate = new Paginate(list.length, useState(0));
    return (
        <>
            <div className={responsive}>
                {list.filter((i, number) => number === paginate.currentPage)}
                <Scrolling length={list.length} paginate={paginate} onClick={()=>{}}/>
            </div>
        </>
    );
}

export default RowImages;
